Brought the team to @soundrunning TEN get something special done last night! This was the goal for Joe, Alicia and Jonas all winter.

@monsonalicia put out an amazing effort grinding her way to the 10,000m American Record in 30:03. @josettenorris stepped up to pace her through 5k then it was just a tough steady grind all the way. No pace lights needed for these women, they were locked in. She can focus like like nobody else! Leading almost every step of the second half she was determined and we knew she was ready for something special. She delivered as always. 

@joe_klecker took the race by the horns also and wasn’t afraid to go for it. @ollihoare came in after a massive month of travel just to help the boys get as far as possible. Selfless in his support of the guys. Thank you Ollie. Very proud of Joe going for it, World Standard and big PB. He just keeps getting better. 

@raessjonas in his first 10k ever with a 27:26. So much more in the future for him in this event. 

Thank you team for an amazing winter of racing. Now back to Boulder to recharge and rebuild for the summer!

📸 @kevmofoto 
#OAC #onathleticsclub @on_running

What an incredible night for the OAC in Oslo for the @bislettgames @diamondleagueathletics. 

@yaredthegoose @mariogarciaromo and @ollihoare all 3:29 for 1500m in the same race! Ollie’s was an Australian national record and Yared’s was a North American Record.

@joe_klecker with a 12:56 for his 3rd sub 13:00 5k of the year! Three times in one year already, amazing! 

@monsonalicia 4th in 8:29, her third time sub 8:30 for the 3000m! 

@josettenorris a mile PB of 4:21!

We had so much of the team there, six athletes and so many of our @on_running family in attendance. The team believes in each other and continues to push to new heights! 

#onathleticsclub #OAC

Ready for more of this today at the US Champs starting today! 

